    constructor(public http: CustomHttpService) { }


    addProfile(model: any) {
        return this.http.post('/User/AddUpdateEmployeeUser', model).then(res => res)
    }
    addAddress(model: any) {
        return this.http.post('/User/AddUpdateEmployeeAddress', model).then(res => res)
    }

    getProfile(mail: any) {
        return this.http.get('/User/GetEmployeeProfileByEmail?email=' + mail).then(res => res)
    }

    changePassword(model: any) {
        return this.http.post('/Tenant/ChangeUserLoginPassword', model).then(res => res)
    }
    empolyeePassword(id: any, password: any) {
        return this.http.get('/TransportManager/UpdateEmployeePassword?employeeId=' + id + '&employeePassword=' + password).then(res => res)
    }
    confirmPassword(id: any, password: any) {
        return this.http.get('/User/CheckEmployeePassword?employeeId=' + id + '&password=' + password).then(res => res)
    }
    getStateCityCountyList(zipCode: any) {
        return this.http.get("/Master/GetCityStateCountyByZipCodebysearchkey?Searchkey=" + zipCode).then(res => res);
    }
    getCountryList() {
        return this.http.get("/Master/GetCountryCodes").then(res => res);
    }

    verifyPassword(userName: any, password: any) {
        return this.http.get('/Tenant/CheckExistingPassword?userName=' + userName + '&password=' + password).then(res => res)
    }

    //Fileupload
    fileupload(file: FormData, Id: number) {
        return this.http.postfile("/Master/AzureFileUpload?id=" + Id + "&Path=Employee/EmployeeProfilePhoto", file).then(res => res)
    }
    // fileDelete
    fileDelete(file: any, filepath: any) {
        return this.http.get('/Master/DeleteBlobName?filePath=' + filepath + '&fileName=' + file).then(res => res)
    }

    addRoles(model: any) {
        return this.http.post('/Tenant/AddupdateRoles', model).then(res => res)
    }

    getRolelist() {
        return this.http.get('/Master/GetAdminRoles').then(res => res)
    }
    getRolesuser(roleID: any) {
        return this.http.get('/Tenant/GetRoleMenuByRoleId?roleId=' + roleID).then(res => res)
    }
    getemptyRoles(id:any){
        return this.http.get('/Tenant/GetRootMenuMastersbyRoleid?Roleid='+id).then(res => res)
    }
    deleteRoles(id:any){
        return this.http.get('/Master/DeleteRolesMaster?roleId='+id).then(res=>res)
    }

